import React, { useState } from 'react'
import PayPal from "./PayPal";

function PayPalr() {
  const [checkout, setCheckOut] = useState(false); 

  return (
    <div className="PayPalr">
      {checkout ? (
        <PayPal />

      ) : (
      <button

      onClick={() => {
        setCheckOut(true);
      }}
      >

         Pay Now</button>
      )}

    </div>
  );

}

export default PayPalr;
